  $this->Nm_lang['lang_label_contenttermsofuse'] = "<div class=\"content-terms-of-use\" style=\"text-align:justify\">Declaro estar plenamente esclarecido e consciente de minha responsabilidade no uso do SISTEMA CNSDATA, comprometendo-me a:<br>     <strong>a)</strong>	não divulgar, sob qualquer forma ou meio, os dados de código de acesso, usuário e senha inerentes ou quaisquer informações de acesso restrito em qualquer módulo do CNSDATA, inclusive para outros funcionários da operadora;<br>     <strong>b)</strong>	não divulgar quaisquer dados individualizados dos beneficiários do respectivo plano privado de assistência à saúde, para qualquer outra finalidade que não esteja diretamente ligada a execução contratual de aquisição ou renovação de plano privado de assistência à saúde do respectivo beneficiário, inclusive para outros funcionários da operadora;<br>     <strong>c)</strong>	guardar sigilo e zelar pela privacidade das pessoas e fatos a elas relacionadas/listadas nesta base de dados, não divulgando, por quaisquer meios, dados ou informações contendo os nomes ou quaisquer outras variáveis que permitam a identificação de indivíduos ou que afetem a sua privacidade;<br>     <strong>d)</strong>	guardar sigilo sobre as credenciais de autenticação (código de acesso, usuário e senha) fornecidas para acesso a esta base de dados;<br>     <strong>e)</strong>	não repassar, comercializar ou transferir a terceiros as informações individualizadas em sua integridade ou qualquer parte, objeto deste termo, de qualquer forma que viole seu sigilo;<br>     <strong>f)</strong>	não disponibilizar emprestar ou permitir acesso de pessoas ou instituições não autorizadas a esta base de dados;<br>     <strong>g)</strong>	não praticar ou permitir qualquer ação que comprometa a integridade da base de dados; e<br>     <strong>h)</strong>	certificar que a sessão aberta no ambiente computacional foi finalizada e fechada, quando do término das atividades ou do afastamento do computador, e que para reaver o acesso ao sistema será necessária nova autenticação.<br>     <br>     Por fim, declaro estar ciente e de acordo:<br>     <strong>1.</strong>	com todas as condições constantes neste termo, assumindo inteira responsabilidade pelas consequências legais da utilização indevida desta base de dados; e<br>     <strong>2.</strong>	que se revelar informação obtida mediante acesso aos dados informatizados do Sistema Cartão estarei sujeito às penalidades do art. 325 de Código de Penal, sem prejuízo de outras penalidades; e<br>     <strong>3.</strong>	que se inserir ou facilitar a inserção de dados falsos, alterar ou excluir indevidamente dados corretos no sistema com o fim de obter vantagem indevida para mim ou para outrem ou para causar dano, ou modificar ou alterar o sistema sem autorização ou solicitação de autoridade competente, estarei sujeito às penalidades dos artigos 313-A e 31 3-B do Código Penal, sem prejuízo de outras penalidades, inclusive por outros atos praticados.<br>     <strong>4.</strong>	sem prejuízo da responsabilidade penal e civil, e de outras infrações disciplinares, constitui falta de zelo e dedicação às atribuições do cargo e descumprimento de normas legais e regulamentares, não proceder com cuidado na guarda e utilização de senha ou emprestá-la a outrem, ainda que habilitado.<br>     <strong>5.</strong>	declaro, nesta data, ter ciência e estar de acordo com os procedimentos descritos neste termo, comprometendo-me a respeitá-los e cumpri-los plena e integralmente, além de manter sempre verossímeis os dados de instituição e de minha área de competência.<br> </div>";

